import React, { FC } from "react";
import "./Navbar.scss";
import { Menubar } from "primereact/menubar";

interface NavbarProps {}

const Navbar: FC<NavbarProps> = () => {
  const items = [
    {
      label: "Home",
      command: () => {
        window.location.href = "/";
      }
    },
    {
      label: "About Dee",
      command: () => {
        window.location.href = "/about-dee";
      }
    },
    {
      label: "Upcoming Events",
      command: () => {
        window.location.href = "/";
      }
    },
    {
      label: "Book",
      command: () => {
        window.location.href = "/";
      }
    },
    {
      label: "Film",
      items: [],
    },
    {
      label: "Music",
      items: [],
    },
    {
      label: "More",
      items: [
        {
          label: "Photo Gallery",
          items: [],
        },
        {
          label: "Blog",
          items: [],
        },
        {
          label: "Partners",
          items: [],
        },
        {
          label: "Contact Us",
          items: [],
        },
      ],
    },
  ];
  return <div className="Navbar">
    <Menubar model={items} />
  </div>;
};

export default Navbar;
